import MealsProvider from './MealList/MealProvider';
import Counter from './MealList/Counter';
import MealsList from './MealList/MealList';
import './App.css';


function App() {
  return (
    <div className="App">
      <div className='MealsLister'>
        <MealsProvider>
          <Counter />
          <MealsList />
        </MealsProvider>
      </div>
    </div>
  );
}

export default App;
